import React from 'react';
import { Link, Outlet } from 'react-router-dom';

export default function UserLayout() {
  return (
    <div>
      <nav style={{ padding: '1rem', borderBottom: '1px solid #eee', backgroundColor: '#e3f2fd' }}>
        <strong style={{ color: '#1976d2' }}>User Portal</strong>
        <div style={{ display: 'inline-block', marginLeft: 20 }}>
          <Link to="/user" style={{ marginRight: 15, textDecoration: 'none', color: '#333' }}>Dashboard</Link>
          <Link to="/user/homepage" style={{ marginRight: 15, textDecoration: 'none', color: '#333' }}>Homepage</Link>
          <Link to="/user/contact" style={{ marginRight: 15, textDecoration: 'none', color: '#333' }}>Contact</Link>
          <Link to="/user/careers" style={{ marginRight: 15, textDecoration: 'none', color: '#333' }}>Careers</Link>
          <Link to="/user/profile" style={{ marginRight: 15, textDecoration: 'none', color: '#333' }}>Profile</Link>
        </div>
      </nav>
      <div>
        <Outlet />
      </div>
    </div>
  );
}
